import "./App.css";
import { Route, Routes } from "react-router-dom";
import Container from "./components/Container/Container";
import Menu from "./components/Menu/Menu";

function App() {
  return (
    <Container>
      <Routes>
        <Route path="/" element={Menu}></Route>
      </Routes>
    </Container>
  );
}

export default App;
